create table country
(
    name           text,
    iso2           text,
    iso3           text,
    fips           text,
    continent      text,
    currency       text,
    language_codes text,
    languages      text,
    area           integer,
    internet_hosts integer,
    internet_users integer,
    phonesmobile   integer,
    phoneslandline integer,
    gdp            numeric
);


create unique index countrycode_iso2_uindex
    on country (iso2);

create unique index countrycode_iso3_uindex
    on country (iso3);

create unique index countrycode_name_uindex
    on country (name);

create table migrations_in_out
(
    c1      text
        constraint migrations_in_out_countrycode_iso2_fk
            references country (iso2),
    c2      text
        constraint migrations_in_out_countrycode_iso2_fk_2
            references country (iso2),
    mig_out bigint,
    mig_in  bigint
);







create table all_migrations
(
    c1      text
        constraint all_migrations_countrycode_iso2_fk
            references country (iso2),
    all_out numeric,
    all_in  numeric
);

